    "Advanced Materials and Manufacturing for Low-Cost, High-Performance Liquid Rocket
    Combustion Chambers Project",nt"tracking_summary": {ntt"total": 31,ntt"recent":
    1nt},nt"groups": [],nt"relationships_as_subject": [],nt"revision_timestamp":
    "2015-05-07T05:59:39.246108",nt"name": "advanced-materials-and-manufacturing-for-low-cost-high-performance-liquid-rocket-combustio",nt"isopen":
    true,nt"url": null,nt"notes": "Silicided niobium alloy (C103) combustion
    chambers have been used extensively in both NASA and DoD liquid rocket propulsion
    systems. Niobium alloys offer a good combination of temperature capability, density,
    and cost, while the silicide coating has been successful in providing moderate oxidation
    resistance. However, the silicide coating is now proving to be the limiting factor
    in achieving the required chamber performance and/or lifetime, and the chamber manufacturing
    cost is excessive for many applications. NASA is seeking advanced bipropellant propulsion
    systems for Earth science spacecraft with a specific impulse exceeding 360 seconds,
    and intends to extend the life of the current space shuttle orbiter reaction control
    system vernier thrusters to 300,000 seconds of operation to meet demands for increased
    usage. DoD is seeking economical and high-performance bipropellant thrusters for
    liquid divert and attitude control systems for kinetic energy weapon kill vehicles
    being developed for ballistic missile defense, a high-volume application.  These
    goals cannot be achieved using silicided C103 chambers. In this project, Ultramet
    proposes to demonstrate a combustion chamber with substantially improved manufacturability,
    cost, and performance. This will be accomplished by combining rapid prototyping,
    for the fabrication of precision removable chamber mandrels; a low cost niobium
    alloy component forming process; and chemical vapor deposition, which will be used
    to apply a high temperature oxidation-resistant coating.",nt"license_title":
